import React from 'react';

import Landing from './Landing';

const mainView = props => {


  return (
    <div>
      <Landing />
      <h3 onClick={() => this.setView('random')}>RANDOM PICK</h3>
      <h3 onClick={() => this.setView('custom')}>CUSTOM SEARCH</h3>
    </div>
  );
};

export default mainView;
